import React from 'react';


function BtnComponents(props) {
  return (
    <div>
     {(props.state === 0)?
      <button className=" stopwatch stopwatch-btn stopwatch-btn-gre" onClick={props.start}>Start</button> : " "
     }

     {(props.state === 1)?
     <div>
      <button className=" stopwatch stopwatch-btn stopwatch-btn-red" onClick={props.start}>Stop</button> 
      <button className=" stopwatch stopwatch-btn stopwatch-btn-yel" onClick={props.start}>Reset</button> 

     </div>:" "
     }



    </div>
  );
}

export default BtnComponents;
